import React from 'react';
import s from './Navigation.module.css'

const Navigation = () => {

    const links = [
        { title: 'О нас' },
        { title: 'Контакты' }
    ]

    return (
        <nav className={s.mainNav}>
            <h2 class="text-lg font-bold">СамГТУ</h2>

            <div className='contackList'>
                <a href='/'>О нас</a>
                <a href='/'>Контакты</a>
            </div>
        </nav>
    );
}

export default Navigation;
